        import oracle.odi.domain.model.OdiDataStore
        import oracle.odi.domain.mapping.exception.MappingException

        public class LKM_Object_Storage_to_ADWC_External_Table extends ADWCBaseKM {

                private static final String NEW_LINE = System.getProperty("line.separator");
                protected String extTableName;

                protected String sourceSchemaName;
                protected String sourceSchema;
                protected String resourceName;
                protected String region;
                protected String tenant;
                protected String sourceLocation;

                protected List<String> formatProperties;
		        private String customUnloadFieldSeparator;
		        protected String fileFormat;
		        protected String fieldSeparator;

		        protected int skipHeaders;

                public void setBinding(Binding binding) {

                    super.setBinding(binding);

                    Map variables = binding.getVariables();

                    // Cannot use this call because we need a short name with no prefix, limitaion of ADWC for now
                    // String accessName = generatorContext.getAPNodeCollTableAccessName();

                    boolean isUnique = physicalNode.getPhysicalDesign().isConcurrent();
                    String accessName = "";

                    if (isUnique) {
                      accessName = '<?=odiRef.getObjectShortName("L", "' + "%COL_PRF" + physicalNode.getCollTableUniquenessDigits() + physicalNode.getStageTableName() + "%UNIQUE_STEP_TAG" + '", "W")?>'
                    } else {
                      accessName = '<?=odiRef.getObjectShortName("L", "' + "%COL_PRF" + physicalNode.getCollTableUniquenessDigits() + physicalNode.getStageTableName() + '", "W")?>'
                    }
                    extTableName = accessName + "_EXT";
                    binding.setVariable("extTableName", extTableName);

                    sourceSchemaName = getSourceSchemaName();
                    binding.setVariable("sourceSchemaName", sourceSchemaName);

                    MapPhysicalNode sourceNode = getSourceNode();

                    if (sourceNode.isAPNode() && sourceNode.getLKM().getName().contains("LKM File to Object Storage")) {
                        sourceNode = getSourceNode(sourceNode);
                    }

		            if (sourceNode.isAPNode() && sourceNode.getLKM().getName().contains("LKM SQL to Object Storage")) {
			            customUnloadFieldSeparator = sourceNode.getLKMOptionValue("FIELD_SEPARATOR").getOptionValueString();
                    }
		            binding.setVariable("customUnloadFieldSeparator", customUnloadFieldSeparator);

                    resourceName = getResourceName(sourceNode);
                    binding.setVariable("resourceName", resourceName);

                    formatProperties = getFormatPropsList();
                    binding.setVariable("formatProperties", formatProperties);

		            fileFormat = "";
		            binding.setVariable("fileFormat", fileFormat);

		            fieldSeparator = "";
		            binding.setVariable("fieldSeparator", fieldSeparator);

		            sourceSchema = '<%=odiRef.getSchemaName("' + sourceSchemaName + '", "D")%>';
		            binding.setVariable("sourceSchema", sourceSchema);

		            region = '<%=odiRef.getDataServerPropertyFromLSchema( "Region", "' + sourceSchemaName + '")%>';
		            binding.setVariable("region", region);

		            tenant = '<%=odiRef.getDataServerPropertyFromLSchema( "Tenant Name", "' + sourceSchemaName + '")%>';
		            binding.setVariable("tenant", tenant);

		            sourceLocation = "https://objectstorage." + region + ".oraclecloud.com/n/" + tenant + "/b/" + sourceSchema;
		            binding.setVariable("sourceLocation", sourceLocation);

		            skipHeaders = 0;
		            binding.setVariable("skipHeaders", skipHeaders);

                }

                AbstractSyntaxTree SELECT (SqlQuery sqlQuery) throws AdapterException, MappingException, GenerationException {

                    String tableName = physicalNode.getStageTableName();
                    String tableAlias = physicalNode.getStageTableAlias();

                    SqlQuery result = createNewQueryForSelect(physicalNode.getTemplateUtils(true));

                    Table srcTable = new Table(tableName, null, extTableName, physicalNode);
                    String tableAliasSeparator = physicalNode.getExecutionTechnology().getTableAliasSeparator();
                    FromClause from = new FromClause(new TableReference(srcTable), tableAlias, tableAliasSeparator == null ? " " : tableAliasSeparator);
                    List<FromClause> fromList = new ArrayList<FromClause>();
                    fromList.add(from);
                    result.setFromList(fromList);
                    result.setSelectList(getSelectExprList(tableAlias));

                    return result;
                }

                String getColNames (MapPhysicalNode node) {
                   def cols = node.getPhysicalColumns()

                   StringBuilder columnBuilder = new StringBuilder();
                   cols.each {
                      if (columnBuilder.length() > 0) {
                         columnBuilder.append(", ");
                      }
                      columnBuilder.append(it.getName());
                   }
                   return columnBuilder.toString();
                }

                String getColDefsFixed (MapPhysicalNode node) {
                   def cols = node.getPhysicalColumns()

                   StringBuilder columnBuilder = new StringBuilder();
                   cols.each {
                      if (columnBuilder.length() > 0) {
                         columnBuilder.append(", ");
                      }
                      columnBuilder.append(it.getName() + " CHAR(" + it.getSize() + ")");
                   }
                   return columnBuilder.toString();
                }

                AbstractSyntaxTree INSERT (SqlQuery sqlQuery) throws AdapterException, MappingException, GenerationException {

                    if (fileFormat.equals("")) {fileFormat = "CSV";}
                    if (fieldSeparator.equals("")) {fieldSeparator = ",";}
                    String recordSeparator = "newline";
                    String textDelimiter = ""

                    if (customUnloadFieldSeparator != null && !customUnloadFieldSeparator.equals("")) {
                      fileFormat = "D";
                      fieldSeparator = customUnloadFieldSeparator;
                    }

                    MapPhysicalNode sourceNode = getSourceNode();

                    if (sourceNode.isAPNode() && sourceNode.getLKM().getName().contains("LKM File to Object Storage")) {
                        sourceNode = getSourceNode(sourceNode);
                    }

                    if (!sourceNode.isAPNode() &&
                        (sourceNode.getExecutionUnit().getExecutionTechnology().getName().equals("File") ||
                         sourceNode.getExecutionUnit().getExecutionTechnology().getName().equals("Oracle Object Storage"))) {

                         OdiDataStore dataStore = (OdiDataStore)sourceNode.getLogicalComponent().getBoundObject();

                         if (sourceNode.getExecutionUnit().getExecutionTechnology().getName().equals("File")) {
                            fileFormat = dataStore.getFileDescriptor().getFormatString();
                         } else {
                            String fileStorageFormat = dataStore.getTableFormatType().getName();
                            if (fileStorageFormat.equals("DELIMITED")) { fileFormat = "D"; }
                            if (fileStorageFormat.equals("FIXED")) { fileFormat = "F"; }
                         }

			             String delimitedOption = getOptionValue("DELIMITED_FILE_FORMAT");
                         if (fileFormat == "D" && delimitedOption == "CSV") {
                           fileFormat = delimitedOption;
                         }

                         skipHeaders = dataStore.getFileDescriptor().getSkipHeadingLines();
                         fieldSeparator = dataStore.getFileDescriptor().getFieldSeparator();
                         recordSeparator = dataStore.getFileDescriptor().getRowSeparator();
                         textDelimiter = dataStore.getFileDescriptor().getTextDelimiter();
                    }

                    List<String> resourceList = getResourceList(resourceName);

                    String colList = generatorContext.getAPNodeCreateTableColumnList();
                    colList = colList.replaceAll(NEW_LINE, " ");

                    String fieldList = "";
                    String generateFileds = getOptionValue("GENERATE_FIELD_LIST");
                    if (fileFormat.equals("F")) { generateFileds = 'true' }

                    if (generateFileds == 'true') {
                      if (getOptionValue("OVERWRITE_FIELD_LIST") != "" && getOptionValue("OVERWRITE_FIELD_LIST") != null) {
                        fieldList = getOptionValue("OVERWRITE_FIELD_LIST");
                      } else {
                        if (!sourceNode.isAPNode()) {
                          if (fileFormat.equals("F")) {
                            fieldList = getColDefsFixed(physicalNode);
                          } else {
                            fieldList = getColNames(physicalNode);
                          }
                        }
                      }
                    }

                    String formatPropertiesPlus = getOptionValue("ADD_FORMAT_PROPERTIES");
                    if (formatPropertiesPlus == null) {formatPropertiesPlus = "";}

                    ExternalTableADWC extTableStatement = new ExternalTableADWC(extTableName,
                                                                                credName,
                                                                                resourceList,
                                                                                sourceLocation,
                                                                                fileFormat,
                                                                                skipHeaders,
                                                                                fieldSeparator,
                                                                                recordSeparator,
                                                                                textDelimiter,
                                                                                colList,
                                                                                fieldList,
                                                                                formatProperties,
                                                                                formatPropertiesPlus);
                    extTableStatement.setIsPushFromSource(false);
                    return extTableStatement;
                }
            }


            public class ExternalTableADWC extends AbstractSyntaxTree {

                private String externalTableName;
                private String credentialName;
                private List<String> resourceList;
                private String directory;
                private String fileFormat;
                private int skipHeaders;
                private String fieldSeparator;
                private String recordSeparator;
                private String textDelimiter;
                private String columnsDefinitions;
                private String fieldsDefinitions;
                private List<String> formatProperties;
                private String formatPropertiesPlus;

                public ExternalTableADWC(String externalTableName,
                                         String credentialName,
                                         List<String> resourceList,
                                         String directory,
                                         String fileFormat,
                                         int skipHeaders,
                                         String fieldSeparator,
                                         String recordSeparator,
                                         String textDelimiter,
                                         String columnsDefinitions,
                                         String fieldsDefinitions,
                                         List<String> formatProperties,
                                         String formatPropertiesPlus) {
                    this.externalTableName = externalTableName;
                    this.credentialName = credentialName;
                    this.resourceList = resourceList;
                    this.directory = directory;
                    this.fileFormat = fileFormat;
                    this.skipHeaders = skipHeaders;
                    this.fieldSeparator = fieldSeparator;
                    this.recordSeparator = recordSeparator;
                    this.textDelimiter = textDelimiter;
                    this.columnsDefinitions = columnsDefinitions;
                    this.fieldsDefinitions = fieldsDefinitions;
                    this.formatProperties = formatProperties;
                    this.formatPropertiesPlus = formatPropertiesPlus;

                }

                public String getType() {
                    return "ExternalTableADWC";
                }

                public List<AbstractSyntaxTree> getChildren() {
                    List children = new ArrayList(0);
                    return children;
                }

                public AbstractSyntaxTree combineTree(AbstractSyntaxTree tree) throws GenerationException {
                    return this;
                }

                public AbstractSyntaxTree cloneAST() throws GenerationException {
                    ExternalTableADWC extTableStatement = new ExternalTableADWC(externalTableName,
                                                                                credentialName,
                                                                                resourceList,
                                                                                directory,
                                                                                fileFormat,
                                                                                skipHeaders,
                                                                                fieldSeparator,
                                                                                recordSeparator,
                                                                                textDelimiter,
                                                                                columnsDefinitions,
                                                                                fieldsDefinitions,
                                                                                formatProperties,
                                                                                formatPropertiesPlus);
                    return extTableStatement;
                }

                public List<Expression> getExpressions() {
                    return null;
                }

                public void addPathPoint(MapConnectorPoint point) {}

                public void resetReferencePath() {}

                public String getExternalTableName() {
                    return externalTableName;
                }

                public String getCredentialName() {
                    return credentialName;
                }

                public List<String> getResourceList() {
                    return resourceList;
                }

                public String getDirectory() {
                    return directory;
                }

                public String getFileFormat() {
                  if (fileFormat != null) {
                    return fileFormat;
                  } else {
                    return "";
                  }
                }

                public String getSkipHeaders() {
                    return skipHeaders;
                }

                public String getFieldSeparator() {
                    return fieldSeparator;
                }

                public String getRecordSeparator() {
                  if (recordSeparator.contains("\\u000A")) {
                    return "newline";
                  } else {
                    return recordSeparator;
                  }
                }

                public String getTextDelimiter() {
                  if (textDelimiter != null) {
                    if (textDelimiter.contains('"')) {
                      return '\\' + textDelimiter;
                    } else {
                      return textDelimiter;
                    }
                  } else {
                    return "";
                  }
                }

                public String getColumnsDefinitions() {
                    return columnsDefinitions;
                }

                public String getFieldsDefinitions() {
                    return fieldsDefinitions;
                }

                public List<String> getFormatProperties() {
                    return formatProperties;
                }

                public String getFormatPropertiesPlus() {
                    return formatPropertiesPlus;
                }

                public String getText(TemplateUtils templateUtils) throws GenerationException {
                    String template = getSelectedTemplate(templateUtils);
                    HashMap templateVar = getTemplateSubstitutionMap();

                    try {
                      String result = oracle.odi.mapping.generation.parser.TemplateParser.mainCodeParser(templateUtils, templateVar, template);
                      return result;
                    } catch (oracle.odi.mapping.generation.parser.ParseException e) {
                      Throwable cause = e.getCause();
                      if (cause instanceof GenerationException) {
                        throw (GenerationException)cause;
                      }
                      throw new GenerationException("Template parser exception: " + e.getMessage(), e);
                    }
                }

                public Map<String,Object> getTemplateSubstitutionMap() {
                  HashMap<String,Object> templateVar = new HashMap<String,Object>();
                  templateVar.put("statement", this);
                  return templateVar;
                }

            }
